r_column-1-5"><div style="" class="fbuilder_droppable" ><div class="fbuilder_module" data-shortcode="heading" data-modid="46"><h4  class="" style="padding-bottom:25px !important; margin-top:0 !important; text-align:left; color:#333333">5. Pages</h4></div><div class="fbuilder_module" data-shortcode="heading" data-modid="47"><h4  class="" style="padding-bottom:15px !important; margin-top:0 !important; text-align:left; color:#333333"><a href="#11">5.1 Portal Page Templates</a></h4></div><div class="fbuilder_module" data-shortcode="heading" data-modid="48"><h4  class="" style="padding-bottom:15px !important; margin-top:0 !important; text-align:left; color:#333333"><a href="#12">5.2 Portal Blog and Portfolio Templates</a></h4></div><div class="fbuilder_module" data-shortcode="heading" data-modid="49"><h4  class="" style="padding-bottom:15px !important; margin-top:0 !important; text-align:left; color:#333333"><a href="#13">5.3 Portal Gallery Template</a></h4></div><div class="fbuilder_module" data-shortcode="heading" data-modid="45"><h4  class="" style="padding-bottom:15px !important; margin-top:0 !important; text-align:left; color:#333333"><a href="#14">5.4 Portal Team Templates</a></h4></div><div class="fbuilder_module" data-shortcode="heading" data-modid="53"><h4  class="" style="padding-bottom:15px !important; margin-top:0 !important; text-align:left; color:#333333"><a href="#15">5.5 Revolution Slider in Pages</a></h4></div></div></div><div style="clear:both;"></div></div></div><div data-rowtype="0" data-rowid="5" style="padding-top:70px;padding-bottom:70px;" class="fbuilder_row"><div class="fbuilder_row_background" style="background-image:url(@@SITE_URL@@/wp-content/uploads/2013/12/53.jpg);background-repeat:repeat;" ></div><div><div data-colnumber="0" class="fbuilder_column fbuilder_column-1-1"><div style="" class="fbuilder_droppable" ><div class="fbuilder_module" data-shortcode="heading" data-modid="52"><h3  class="" style="padding-bottom:0px !important; margin-top:0 !important; text-align:left; color:#ffffff"><strong>Basics</strong> - Provided information in this section and the documentation will help you understand your new theme, and get the most out of it. Please read full documentation on this theme in order to use it properly and in full power.</h3></div></div></div><div style="clear:both;"></div></div></div><div data-rowtype="13" data-rowid="0" id="1" style="padding-top:70px;padding-bottom:70px;" class="fbuilder_row"><div><div data-colnumber="0" class="fbuilder_column fbuilder_column-1-5"><div style="" class="fbuilder_droppable" ><div class="fbuilder_module" data-shortcode="heading" data-modid="7"><h4  class="" style="padding-bottom:0px !important; margin-top:0 !important; text-align:left; color:#333333">1.1 Template Features</h4></div></div></div><div data-colnumber="1" class="fbuilder_column fbuilder_column-4-5"><div style="" class="fbuilder_droppable" ><div class="fbuilder_module" data-shortcode="text" data-modid="39"><div  class="" style="padding-bottom:20px !important; text-align:left"><div class="frb_text">Portal is a HD full screen modern theme for your gallery or portfolio showcase webiste. Packed with Paralax images and videos, galleries and sliders, Portal introduces many new elements for you and your site. Additional functionality is added via the Frontend Builder for creating simple pages and posts. Frontend Builder is equipt with many page layouts you can use instantly. Theme is 100% Responsive and HD Retina Ready. Enojy your new Portal Theme!</div></div></div><div class="fbuilder_module" data-shortcode="heading" data-modid="76"><h4  class="" style="padding-bottom:0px !important; margin-top:0 !important; text-align:left; color:#333333"><a href="#0">⇧ Back to Top </a></h4></div></div></div><div style="clear:both;"></div></div></div><div data-rowtype="13" data-rowid="3" id="2" style="padding-top:70px;padding-bottom:70px;" class="fbuilder_row"><div class="fbuilder_row_background" style="background-color:#ededed;"></div><div><div data-colnumber="0" class="fbuilder_column fbuilder_column-1-5"><div style="" class="fbuilder_droppable" ><div class="fbuilder_module" data-shortcode="heading" data-modid="11"><h4  class="" style="padding-bottom:0px !important; margin-top:0 !important; text-align:left; color:#333333">1.2 Template Tips & Tricks</h4></div></div></div><div data-colnumber="1" class="fbuilder_column fbuilder_column-4-5"><div style="" class="fbuilder_droppable" ><div class="fbuilder_module" data-shortcode="text" data-modid="32"><div  class="" style="padding-bottom:20px !important; text-align:left"><div class="frb_text">    Read full documentation<br />\n    Use only Full HD images for your Featured images (1920x1080px and more)<br />\n    Setup your Featured area content first, and then edit your post inside Frontend Builder<br />\n    Use custom Sidebars in Appearance>Theme Options<br />\n    Use Videos in your Featured content area<br />\n    Use Gallery Template to show your galleries (attached images will be shown)<br />\n</div></div></div><div class="fbuilder_module" data-shortcode="heading" data-modid="77"><h4  class="" style="padding-bottom:0px !important; margin-top:0 !important; text-align:left; color:#333333"><a href="#0">⇧ Back to Top </a></h4></div></div></div><div style="clear:both;"></div></div></div><div data-rowtype="13" data-rowid="4" id="3" style="padding-top:70px;padding-bottom:70px;" class="fbuilder_row"><div><div data-colnumber="0" class="fbuilder_column fbuilder_column-1-5"><div style="" class="fbuilder_droppable" ><div class="fbuilder_module" data-shortcode="heading" data-modid="33"><h4  class="" style="padding-bottom:0px !important; margin-top:0 !important; text-align:left; color:#333333">1.3 Authors and Support</h4></div></div></div><div data-colnumber="1" class="fbuilder_column fbuilder_column-4-5"><div style="" class="fbuilder_droppable" ><div class="fbuilder_module" data-shortcode="text" data-modid="34"><div  class="" style="padding-bottom:20px !important; text-align:left"><div class="frb_text">The Portal theme was designed and developed by Shindiri Studio and Mihajlovicnenad.com. For support on the Portal theme for Wordpress please visit our Support forum, the Portal theme item page on themeforest.net or email us support@shindiristudio.com.</div></div></div><div class="fbuilder_module" data-shortcode="heading" data-modid="78"><h4  class="" style="padding-bottom:0px !important; margin-top:0 !important; text-align:left; color:#333333"><a href="#0">⇧ Back to Top </a></h4></div></div></div><div style="clear:both;"></div></div></div><div data-rowtype="0" data-rowid="7" style="padding-top:70px;padding-bottom:70px;" class="fbuilder_row"><div class="fbuilder_row_background" style="background-image:url(@@SITE_URL@@/wp-content/uploads/2013/12/53.jpg);background-repeat:repeat;" ></div><div><div data-colnumber="0" class="fbuilder_column fbuilder_column-1-1"><div style="" class="fbuilder_droppable" ><div class="fbuilder_module" data-shortcode="heading" data-modid="35"><h3  class="" style="padding-bottom:0px !important; margin-top:0 !important; text-align:left; color:#ffffff"><strong>Installation</strong> - Provided information in this section covers the Portal theme and required plugins installation, setting up the Portal theme and setting up plugins.</h3></div></div></div><div style="clear:both;"></div></div></div><div data-rowtype="13" data-rowid="8" id="4" style="padding-top:70px;padding-bottom:70px;" class="fbuilder_row"><div><div data-colnumber="0" class="fbuilder_column fbuilder_column-1-5"><div style="" class="fbuilder_droppable" ><div class="fbuilder_module" data-shortcode="heading" data-modid="37"><h4  class="" style="padding-bottom:0px !important; margin-top:0 !important; text-align:left; color:#333333">2.1 Installation of the Template</h4></div></div></div><div data-colnumber="1" class="fbuilder_column fbuilder_column-4-5"><div style="" class="fbuilder_droppable" ><div class="fbuilder_module" data-shortcode="text" data-modid="38"><div  class="" style="padding-bottom:20px !important; text-align:left"><div class="frb_text">To install this theme you must have a working version of WordPress already installed. For information on installing the WordPress platform, please see the WordPress Codex - http://codex.wordpress.org/Installing_WordPress. Upon downloading the Portal archive, extract the archive and inside you will find full contents of your purchase. Portal_theme.zip archive contains the installable theme files.<br />\n<br />\nPlease Note: You can install the theme in two ways: inside WordPress, or via FTP. If you have trouble installing the theme inside WordPress, please proceed with installing it via FTP and you will be able to get around the issue<br />\n<br />\nInstalling from WordPress<br />\n<br />\nFollow the steps below to install inside Wordpress<br />\n<br />\n    Navigate to Appearance > Themes<br />\n    Click Install Themes and then Upload<br />\n    Navigate to portal_theme.zip on your computer and click Install Now<br />\n    To activate the newly installed theme navigate to Appearance > Themes select the Portal Theme and press Activate<br />\n    After install, activate the theme and continue to the next section ''Installing plugins''!<br />\n<br />\nInstalling via FTP Server<br />\n<br />\nFollow the steps below to install via FTP<br />\n<br />\n    Unzip portal_theme.zip to a desired location on your HDD. These extracted files will be uploaded later via FTP<br />\n    Connect to your server via FTP<br />\n    Navigate to /wp-content/themes/ on server<br />\n    Navigate to location of unzipped portal_theme.zip<br />\n    Upload local folder /portal/ to remote /wp-content/themes/<br />\n    To activate the newly installed theme navigate to Appearance > Themes select the Portal Theme and press Activate<br />\n    After install, activate the theme and continue to the next section ''Installing plugins''!<br />\n<br />\nMigrating from another theme<br />\n<br />\nIf you have already used WordPress with another theme and you''re migrating to Portal Theme please use the Regenerate Thumbnails plugin to resize all the images uploaded on server. Click the link above and download the free plugin, activate the plugin and regenerate your thumbnails.</div></div></div><div class="fbuilder_module" data-shortcode="heading" data-modid="79"><h4  class="" style="padding-bottom:0px !important; margin-top:0 !important; text-align:left; color:#333333"><a href="#0">⇧ Back to Top </a></h4></div></div></div><div style="clear:both;"></div></div></div><div data-rowtype="13" data-rowid="9" id="5" style="padding-top:70px;padding-bottom:70px;" class="fbuilder_row"><div class="fbuilder_row_background" style="background-color:#ededed;"></div><div><div data-colnumber="0" class="fbuilder_column fbuilder_column-1-5"><div style="" class="fbuilder_droppable" ><div class="fbuilder_module" data-shortcode="heading" data-modid="50"><h4  class="" style="padding-bottom:0px !important; margin-top:0 !important; text-align:left; color:#333333">2.2 Installation of the Plugins</h4></div></div></div><div data-colnumber="1" class="fbuilder_column fbuilder_column-4-5"><div style="" class="fbuilder_droppable" ><div class="fbuilder_module" data-shortcode="text" data-modid="51"><div  class="" style="padding-bottom:20px !important; text-align:left"><div class="frb_text">Upon installation and activation of the Portal Theme you''ll be noted to install Plugins used with this theme.<br />\nPortal Theme uses the following plugins :<br />\n<br />\n    FrontEnd Builder by Shindiri Studio LINK / REQUIRED<br />\n    Easy Bootstrap Shortcode LINK / REQUIRED<br />\n    WordPress Visual Icon Fonts LINK / REQUIRED<br />\n    Revolution Slider LINK<br />\n    WordPress Visual Icon Fonts LINK<br />\n    Flickr Badges Widget LINK<br />\n    Video Embed & Thumbnail Generator LINK<br />\n<br />\nThe required plugins must be installed. The Portal theme will not work properly if these plugins are not installed. To get all the options for this package please install all avaiable plugins. It''s highly recommended to install all plugins at this stage. For documentation on these plugins you can read more on the Plugin Websites.<br />\n<br />\nUpon Plugin installation you''ll be noted again to activate the installed plugins. Activate all the installed plugins.</div></div></div><div class="fbuilder_module" data-shortcode="heading" data-modid="80"><h4  class="" style="padding-bottom:0px !important; margin-top:0 !important; text-align:left; color:#333333"><a href="#0">⇧ Back to Top </a></h4></div></div></div><div style="clear:both;"></div></div></div><div data-rowtype="13" data-rowid="12" id="6" style="padding-top:70px;padding-bottom:70px;" class="fbuilder_row"><div><div data-colnumber="0" class="fbuilder_column fbuilder_column-1-5"><div style="" class="fbuilder_droppable" ><div class="fbuilder_module" data-shortcode="heading" data-modid="36"><h4  class="" style="padding-bottom:0px !important; margin-top:0 !important; text-align:left; color:#333333">2.3 Setting the Theme Options</h4></div></div></div><div data-colnumber="1" class="fbuilder_column fbuilder_column-4-5"><div style="" class="fbuilder_droppable" ><div class="fbuilder_module" data-shortcode="text" data-modid="54"><div  class="" style="padding-bottom:20px !important; text-align:left"><div class="frb_text">After you''ve done the first two steps of installing the theme and plugins you can continue to Appearance > Theme Options to set your Theme Settings and Style.<br />\nGeneral Settings<br />\n<br />\nGeneral Settings include your Logo. Use Upload Logo to change the default Portal Logo. Click Upload and use WordPress UI to upload or choose your previously uploaded image. If you don’t want to use logo image click Remove and leave the field blank. For best effect use transparent .png images that will blend into your header.<br />\nStyle Settings<br />\n<br />\nThis section is used for styling the Portal Theme. Here you can select the font used with the layout and tweak the theme colors. With these options you can make your Portal theme look quite unique. Please experiment!<br />\nSidebar Settings<br />\n<br />\nUse these settings to create your new sidebars and once created, used them in your pages or posts. To create a new Sidebar that you can use in your pages or posts simply click Add New Sidebar enter title and Save Changes. Once this is done your new Sidebar will appear under Appearance > Widgets and it will be ready to use. Create as many Sidebars as you need. Insert widgets and use Frontend Builder to create layouts with your new sidebars in pages or posts.<br />\nFooter Settings<br />\n<br />\nThese options define your Footer Widget Areas and your copyright information. The Footer Widget Areas is used to define how many columns you have in your footer. One to four are the options. Bellow these options are your websites social network pages. Enter full URL''s of your pages.<br />\nContact Settings<br />\n<br />\nThese are your contacts, team member profiles. Your Contact Settings / Team Member default options are Name, Picture, Email, Job, Description and Social Networks. You can add as much contacts as you want. Use Upload to upload image representing the contact and fill in the needed infmoration. To add a new social icon for the contact click Add Network. The input field is the URL of the profile and select box is used to select the appropriate icon. These icons can be replaced with your custom sets that you own. To do this you will need to replace the default icons on your server which are located in wp-content/themes/portal/images/socialnetworks. Delete the old files or just fill the directory with icons you would like to use. These Contact Settings / Team Memebers are used on team page templates and in Frontend Builder Contact form element.<br />\nTwitter Settings<br />\n<br />\nIn order to use Twitter properly you will need to create an account for you site on Twitter Development pages. Create an account and create your Application. Follow the instrucions on Twitter Development webpage and you will get you secret keys to bind your Portal Theme with your Twitter Account. Enter values provided by Twitter website.<br />\nAdvanced Settings<br />\n<br />\nThese are the advanced options. Responsive means that the Portal theme will adopt a mobile application styled display when viewed on mobiles and handheld devices. If this option is OFF site will render in 1024px wide non-responsive layout that mobile and handheld users can zoom and explore. Select what you prefer. More options aviable are Tracking Code and the Cusotm CSS options. Tracking Code is used to insert scripts into your site header just before the </head> tag. You can use it for Google Analytics or other services that help you track your sites progress. Custom CSS is a special option that should only be used by advanced users to add corrections to the layout that they need without having to alter the theme itself. Also here you can enable comments on pages and activate the service mode. Service mode will enable the Theme Settings Bar on the side where you can quickly experiment with theme colors and style.<br />\n<br />\nBy now you have set up your Portal theme and it’s ready to use! Now you can create some Posts and Pages! Have fun!</div></div></div><div class="fbuilder_module" data-shortcode="heading" data-modid="81"><h4  class="" style="padding-bottom:0px !important; margin-top:0 !important; text-align:left; color:#333333"><a href="#0">⇧ Back to Top </a></h4></div></div></div><div style="clear:both;"></div></div></div><div data-rowtype="0" data-rowid="13" style="padding-top:70px;padding-bottom:70px;" class="fbuilder_row"><div class="fbuilder_row_background" style="background-image:url(@@SITE_URL@@/wp-content/uploads/2013/12/53.jpg);background-repeat:repeat;" ></div><div><div data-colnumber="0" class="fbuilder_column fbuilder_column-1-1"><div style="" class="fbuilder_droppable" ><div class="fbuilder_module" data-shortcode="heading" data-modid="55"><h3  class="" style="padding-bottom:0px !important; margin-top:0 !important; text-align:left; color:#ffffff"><strong>Update</strong> - Provided information in this section covers the Portal theme updating and plugins update.</h3></div></div></div><div style="clear:both;"></div></div></div><div data-rowtype="13" data-rowid="14" id="7" style="padding-top:70px;padding-bottom:70px;" class="fbuilder_row"><div><div data-colnumber="0" class="fbuilder_column fbuilder_column-1-5"><div style="" class="fbuilder_droppable" ><div class="fbuilder_module" data-shortcode="heading" data-modid="56"><h4  class="" style="padding-bottom:0px !important; margin-top:0 !important; text-align:left; color:#333333">3.1 Updating the Template</h4></div></div></div><div data-colnumber="1" class="fbuilder_column fbuilder_column-4-5"><div style="" class="fbuilder_droppable" ><div class="fbuilder_module" data-shortcode="text" data-modid="57"><div  class="" style="padding-bottom:20px !important; text-align:left"><div class="frb_text">When updating to a newer version please read the !!! UPDATING PORTAL - IMPORTANT.txt in order to know what has been updated, what are the new options, and stuff that you should pay attention to. If you''re constantly updating your system (which is recommended) this file will help you a lot!<br />\n<br />\nUpdating Portal Theme<br />\n<br />\n    Navigate Appearance>Themes<br />\n    Select TwentyThirteen default theme<br />\n    Delete the Portal Theme<br />\n    Select Install Theme and choose Upload<br />\n    Upload the latest portal_theme.zip downloaded from themeforest.net<br />\n    Activate the updated Portal Theme<br />\n</div></div></div><div class="fbuilder_module" data-shortcode="heading" data-modid="82"><h4  class="" style="padding-bottom:0px !important; margin-top:0 !important; text-align:left; color:#333333"><a href="#0">⇧ Back to Top </a></h4></div></div></div><div style="clear:both;"></div></div></div><div data-rowtype="13" data-rowid="16" id="8" style="padding-top:70px;padding-bottom:70px;" class="fbuilder_row"><div class="fbuilder_row_background" style="background-color:#ededed;"></div><div><div data-colnumber="0" class="fbuilder_column fbuilder_column-1-5"><div style="" class="fbuilder_droppable" ><div class="fbuilder_module" data-shortcode="heading" data-modid="60"><h4  class="" style="padding-bottom:0px !important; margin-top:0 !important; text-align:left; color:#333333">3.1 Updating Plugins</h4></div></div></div><div data-colnumber="1" class="fbuilder_column fbuilder_column-4-5"><div style="" class="fbuilder_droppable" ><div class="fbuilder_module" data-shortcode="text" data-modid="61"><div  class="" style="padding-bottom:20px !important; text-align:left"><div class="frb_text">Updating Frontend Builder<br />\n<br />\n    Navigate Plugins>Installed Plugins<br />\n    Deactivate Frontend Builder<br />\n    Delete Frontend Builder<br />\n    Click Add New and choose Upload<br />\n    Upload the latest frontend_builder_**.zip found in the full archive downloaded from themeforest.net (full_plugins folder)<br />\n    Activate the updated Frontend Builder<br />\n<br />\nUpdating Revolution Slider<br />\n<br />\n    Navigate Revolution Slider<br />\n    Click Update button in the bottom right corner of the screen<br />\n    Upload the latest revslider.zip found in the full archive downloaded from themeforest.net (full_plugins folder)<br />\n</div></div></div><div class="fbuilder_module" data-shortcode="heading" data-modid="83"><h4  class="" style="padding-bottom:0px !important; margin-top:0 !important; text-align:left; color:#333333"><a href="#0">⇧ Back to Top </a></h4></div></div></div><div style="clear:both;"></div></div></div><div data-rowtype="0" data-rowid="15" style="padding-top:70px;padding-bottom:70px;" class="fbuilder_row"><div class="fbuilder_row_background" style="background-image:url(@@SITE_URL@@/wp-content/uploads/2013/12/53.jpg);background-repeat:repeat;" ></div><div><div data-colnumber="0" class="fbuilder_column fbuilder_column-1-1"><div style="" class="fbuilder_droppable" ><div class="fbuilder_module" data-shortcode="heading" data-modid="58"><h3  class="" style="padding-bottom:0px !important; margin-top:0 !important; text-align:left; color:#ffffff"><strong>Posts</strong> - Provided information in this section covers the Portal theme post types and custom post settings. You can also use Frontend Builder to create complex templates for your posts. Frontend Builder is packed with the Page/Post layouts for easier and faster workflow.</h3></div></div></div><div style="clear:both;"></div></div></div><div data-rowtype="13" data-rowid="17" id="9" style="padding-top:70px;padding-bottom:70px;" class="fbuilder_row"><div><div data-colnumber="0" class="fbuilder_column fbuilder_column-1-5"><div style="" class="fbuilder_droppable" ><div class="fbuilder_module" data-shortcode="heading" data-modid="59"><h4  class="" style="padding-bottom:0px !important; margin-top:0 !important; text-align:left; color:#333333">4.1 Portal Post Styles</h4></div></div></div><div data-colnumber="1" class="fbuilder_column fbuilder_column-4-5"><div style="" class="fbuilder_droppable" ><div class="fbuilder_module" data-shortcode="text" data-modid="62"><div  class="" style="padding-bottom:20px !important; text-align:left"><div class="frb_text">Portal theme supports 5 post styles. Featured Image, Paralax Featured Image, Chapter Gallery, Video and Paralax Video. You can select any of these post type in the Post Style metabox. Set your featured image and use it in Featured Image, Paralax Featured Image or Chapter Gallery. If you want to use the video override it with URLs for MP4 format and the OGG format for support on all devices. Video can be used in the Chapter Gallery, Video and Paralax Video post style. In order to hide title, meta or tags at the bottom of current single post check the checkbox for that option. Fullscreen checkbox will disable top and bottom margins on single posts so that your post can start from the absolute top before header.<br><br />\n<img src="http://www.shindiristudio.com/envato/portal/documentation/images/metabox_post_style.png"></img><br />\n<br />\n</div></div></div><div class="fbuilder_module" data-shortcode="heading" data-modid="84"><h4  class="" style="padding-bottom:0px !important; margin-top:0 !important; text-align:left; color:#333333"><a href="#0">⇧ Back to Top </a></h4></div></div></div><div style="clear:both;"></div></div></div><div data-rowtype="13" data-rowid="18" id="10" style="padding-top:70px;padding-bottom:70px;" class="fbuilder_row"><div class="fbuilder_row_background" style="background-color:#ededed;"></div><div><div data-colnumber="0" class="fbuilder_column fbuilder_column-1-5"><div style="" class="fbuilder_droppable" ><div class="fbuilder_module" data-shortcode="heading" data-modid="63"><h4  class="" style="padding-bottom:0px !important; margin-top:0 !important; text-align:left; color:#333333">4.2 Portal Post Sidebars</h4></div></div></div><div data-colnumber="1" class="fbuilder_column fbuilder_column-4-5"><div style="" class="fbuilder_droppable" ><div class="fbuilder_module" data-shortcode="text" data-modid="64"><div  class="" style="padding-bottom:20px !important; text-align:left"><div class="frb_text">Use the Sidebar metabox to select your sidebar you wish to use with the post. You can create new sidebars in Appearance>Theme Options and add widgets to them in Appearance>Widgets.<br><br><img src="http://www.shindiristudio.com/envato/portal/documentation/images/metabox_post_sidebar.png"></img></div></div></div><div class="fbuilder_module" data-shortcode="heading" data-modid="85"><h4  class="" style="padding-bottom:0px !important; margin-top:0 !important; text-align:left; color:#333333"><a href="#0">⇧ Back to Top </a></h4></div></div></div><div style="clear:both;"></div></div></div><div data-rowtype="0" data-rowid="19" style="padding-top:70px;padding-bottom:70px;" class="fbuilder_row"><div class="fbuilder_row_background" style="background-image:url(@@SITE_URL@@/wp-content/uploads/2013/12/53.jpg);background-repeat:repeat;" ></div><div><div data-colnumber="0" class="fbuilder_column fbuilder_column-1-1"><div style="" class="fbuilder_droppable" ><div class="fbuilder_module" data-shortcode="heading" data-modid="65"><h3  class="" style="padding-bottom:0px !important; margin-top:0 !important; text-align:left; color:#ffffff"><strong>Pages</strong> - Provided information in this section covers the Portal theme page templates and custom page settings. You can also use Frontend Builder to create complex templates for your pages. Frontend Builder is packed with the Page/Post layouts for easier and faster workflow.</h3></div></div></div><div style="clear:both;"></div></div></div><div data-rowtype="13" data-rowid="20" id="11" style="padding-top:70px;padding-bottom:70px;" class="fbuilder_row"><div><div data-colnumber="0" class="fbuilder_column fbuilder_column-1-5"><div style="" class="fbuilder_droppable" ><div class="fbuilder_module" data-shortcode="heading" data-modid="66"><h4  class="" style="padding-bottom:0px !important; margin-top:0 !important; text-align:left; color:#333333">5.1 Portal Page Templates</h4></div></div></div><div data-colnumber="1" class="fbuilder_column fbuilder_column-4-5"><div style="" class="fbuilder_droppable" ><div class="fbuilder_module" data-shortcode="text" data-modid="67"><div  class="" style="padding-bottom:20px !important; text-align:left"><div class="frb_text">Portal theme has built in 5 page templates.<br />\n<br />\n    Blog Template<br />\n    Gallery Template<br />\n    Portfolio Template<br />\n    Team Template<br />\n    Small Team Temaplate<br />\n<br><br><img src="http://www.shindiristudio.com/envato/portal/documentation/images/metabox_page_templates.png"></img></div></div></div><div class="fbuilder_module" data-shortcode="heading" data-modid="86"><h4  class="" style="padding-bottom:0px !important; margin-top:0 !important; text-align:left; color:#333333"><a href="#0">⇧ Back to Top </a></h4></div></div></div><div style="clear:both;"></div></div></div><div data-rowtype="13" data-rowid="21" id="12" style="padding-top:70px;padding-bottom:70px;" class="fbuilder_row"><div class="fbuilder_row_background" style="background-color:#ededed;"></div><div><div data-colnumber="0" class="fbuilder_column fbuilder_column-1-5"><div style="" class="fbuilder_droppable" ><div class="fbuilder_module" data-shortcode="heading" data-modid="68"><h4  class="" style="padding-bottom:0px !important; margin-top:0 !important; text-align:left; color:#333333">5.2 Portal Blog and Portfolio Templates</h4></div></div></div><div data-colnumber="1" class="fbuilder_column fbuilder_column-4-5"><div style="" class="fbuilder_droppable" ><div class="fbuilder_module" data-shortcode="text" data-modid="69"><div  class="" style="padding-bottom:20px !important; text-align:left"><div class="frb_text">These templates are used to show your latest portfolio or blog posts. In the Portal Blog/Portfolio Template metabox set the category which will be used with these templates.<br />\n<br><br><img src="http://www.shindiristudio.com/envato/portal/documentation/images/metabox_categories.png"></img></div></div></div><div class="fbuilder_module" data-shortcode="heading" data-modid="87"><h4  class="" style="padding-bottom:0px !important; margin-top:0 !important; text-align:left; color:#333333"><a href="#0">⇧ Back to Top </a></h4></div></div></div><div style="clear:both;"></div></div></div><div data-rowtype="13" data-rowid="22" id="13" style="padding-top:70px;padding-bottom:70px;" class="fbuilder_row"><div><div data-colnumber="0" class="fbuilder_column fbuilder_column-1-5"><div style="" class="fbuilder_droppable" ><div class="fbuilder_module" data-shortcode="heading" data-modid="70"><h4  class="" style="padding-bottom:0px !important; margin-top:0 !important; text-align:left; color:#333333">5.3 Portal Gallery Template</h4></div></div></div><div data-colnumber="1" class="fbuilder_column fbuilder_column-4-5"><div style="" class="fbuilder_droppable" ><div class="fbuilder_module" data-shortcode="text" data-modid="71"><div  class="" style="padding-bottom:20px !important; text-align:left"><div class="frb_text">Gallery template is used for your galleries. Attach images to your page and select this template. In the Portal Page Gallery Template metabox select which feature you want to use for your gallery cover featured area. Also add some text in the WP content which will appear on top of the cover image/video with paralax effects.<br />\n<br><br><img src="http://www.shindiristudio.com/envato/portal/documentation/images/metabox_gallery.png"></img></div></div></div><div class="fbuilder_module" data-shortcode="heading" data-modid="88"><h4  class="" style="padding-bottom:0px !important; margin-top:0 !important; text-align:left; color:#333333"><a href="#0">⇧ Back to Top </a></h4></div></div></div><div style="clear:both;"></div></div></div><div data-rowtype="13" data-rowid="23" id="14" style="padding-top:70px;padding-bottom:70px;" class="fbuilder_row"><div class="fbuilder_row_background" style="background-color:#ededed;"></div><div><div data-colnumber="0" class="fbuilder_column fbuilder_column-1-5"><div style="" class="fbuilder_droppable" ><div class="fbuilder_module" data-shortcode="heading" data-modid="72"><h4  class="" style="padding-bottom:0px !important; margin-top:0 !important; text-align:left; color:#333333">5.4 Portal Team Templates</h4></div></div></div><div data-colnumber="1" class="fbuilder_column fbuilder_column-4-5"><div style="" class="fbuilder_droppable" ><div class="fbuilder_module" data-shortcode="text" data-modid="73"><div  class="" style="padding-bottom:20px !important; text-align:left"><div class="frb_text">These two templates are used to showcase your team. Team members are set in the Appearance>Theme Options under "Contact Settings" tab. Add you conntacts and display them via these two templates.</div></div></div><div class="fbuilder_module" data-shortcode="heading" data-modid="89"><h4  class="" style="padding-bottom:0px !important; margin-top:0 !important; text-align:left; color:#333333"><a href="#0">⇧ Back to Top </a></h4></div></div></div><div style="clear:both;"></div></div></div><div data-rowtype="13" data-rowid="24" id="15" style="padding-top:70px;padding-bottom:70px;" class="fbuilder_row"><div><div data-colnumber="0" class="fbuilder_column fbuilder_column-1-5"><div style="" class="fbuilder_droppable" ><div class="fbuilder_module" data-shortcode="heading" data-modid="74"><h4  class="" style="padding-bottom:0px !important; margin-top:0 !important; text-align:left; color:#333333">5.5 Revolution Slider in Pages</h4></div></div></div><div data-colnumber="1" class="fbuilder_column fbuilder_column-4-5"><div style="" class="fbuilder_droppable" ><div class="fbuilder_module" data-shortcode="text" data-modid="75"><div  class="" style="padding-bottom:20px !important; text-align:left"><div class="frb_text">In order to use Revolution Slider in pages as the full width slider, select from the Revolution Slider metabox which slider you wish to use. Make sure you''ve created such a slider in Revolution Slider UI. You can also insert Revolution Slider via Frontend Builder but in separate columns and with margins and paddings. To achieve the full width effect please use the metabox.<br />\n<br><br><img src="http://www.shindiristudio.com/envato/portal/documentation/images/metabox_revolution.png"></img></div></div></div><div class="fbuilder_module" data-shortcode="heading" data-modid="90"><h4  class="" style="padding-bottom:0px !important; margin-top:0 !important; text-align:left; color:#333333"><a href="#0">⇧ Back to Top </a></h4></div></div></div><div style="clear:both;"></div></div></div><div data-rowtype="0" data-rowid="10" style="padding-top:85px;padding-bottom:85px;" class="fbuilder_row"><div class="fbuilder_row_background" style="background-color:#ededed;"></div><div><div data-colnumber="0" class="fbuilder_column fbuilder_column-1-1"><div style="" class="fbuilder_droppable" ><div class="fbuilder_module" data-shortcode="heading" data-modid="12"><h3  class="" style="padding-bottom:35px !important; margin-top:0 !important; text-align:center; color:#333333">If You Like <strong>Portal </strong>Template</h3></div><div class="fbuilder_module" data-shortcode="button" data-modid="13"><div  class="" style="padding-bottom:0px !important;"><div class="frb_textcenter"><a class="frb_button  frb_center" href="" style="font-size:14px; line-height:14px; padding:25px 30px; color:#ffffff; background:#ef5a32; border-color:#ef5a32" data-textcolor="#ffffff" data-backcolor="#ef5a32" data-hovertextcolor="#ffffff" data-hoverbackcolor="#f27e62">Go ahead and buy it</a></div><div style="clear:both;"></div></div></div></div></div><div style="clear:both;"></div></div></div>\n				</div>\n				<div style="clear:both"></div>\n			</div>\n			<div style="clear:both"></div>\n		</div>\n		', 'FAQ', '', 'publish', 'open', 'open', '', 'faq', '', '', '2014-01-10 17:47:21', '2014-01-10 17:47:21', '', 0, '@@SITE_URL@@/?page_id=2841', 0, 'page', '', 0),
